<!DOCTYPE html>
<html lang="en">
<head>
    <meta name="csrf-token" content="{{ csrf_token() }}" />
    <title>测试接口</title>
</head>
<body>
<div id="test">

</div>
</body>
</html>

<script type="text/javascript" src="/js/jquery.min.js"></script>

<script>

    var json = {
        'number':'YJ-200630001',
        'a_en_name':'1','a_cn_name':'1','a_phone':'1','a_email':'1','a_province':'1','a_city':'1','a_area':'1','a_detail':'1','a_postcode':'1',
        'b_en_name':'1','b_cn_name':'1','b_phone':'1','b_email':'1','b_province':'1','b_city':'1','b_area':'1','b_detail':'1','b_postcode':'1',
        'type':'上门取件','date':'2020-06-29','packaging':'1','tax':'0','note':'带句话啊',
        'itemsArr':{
            0:{
                'sort':'纸箱',
                'number':'1'
            },
            1:{
                'sort':'行李箱',
                'number':'1'
            },
            2:{
                'sort':'其他',
                'number':'其他物品1'
            }
        },
        'warehouse_id':'1',
        'picture':{0:'data:image/jpeg;base64,'}
    };

    json = JSON.stringify(json);
    var url = "http://www.wuliu.cn/mail/pay_update";

    $.ajax({
        url: url,
        type: "post",
        contentType: "application/json; charset=utf-8",
        data: json,
        xhrFields: {
            withCredentials: true
        },
        headers: {
            'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
        },
        success:function(msg){
            var str= JSON.stringify(msg);
            $("#test").text(str);
        },
        error: function (msg) {
            var str= JSON.stringify(msg);
            $("#test").text(str);
        }
    });

</script>
